solution:
Đầu tiên, hãy chú ý $2x - xy = x(2 - y)$. Vì vậy, vấn đề này giảm xuống để tìm các giá trị của $x $ và $y $.

Cộng hai phương trình lại với nhau để tìm $x$: \begin{align*}
2x &= 20, \\
x &= 10.
\end{align*}
Trừ hai phương trình để tìm $y$: \begin{align*}
2y &= 4, \\
y &= 2.
\end{align*}
Vì $y = 2$ và $x = 10$, $x(2 - y) = 10(2 - 2) = \boxed{0}$.

Chúng ta áp dụng thuộc tính phân phối để get\begin{align*}
7(3y+2) &= 7\cdot 3y+7\cdot 2\\
&= \boxed{21y+14}.
\end{align*}

Hãy để số lượng chú hề trong cuộc diễu hành là $c đô la và số lượng ngựa là $h đô la. Chúng tôi đang tìm kiếm giá trị của $h$. Giả sử rằng mỗi chú hề có 2 chân và 1 đầu, và mỗi con ngựa có 4 chân và 1 đầu, chúng ta có thể thiết lập hệ phương trình sau:

\begin{align*}
2c + 4h &= 30 \\
c + h &= 10 \\
\end{align*}

Để giải quyết cho $h $, chúng ta cần loại bỏ $c $ khỏi các phương trình trên. Chúng ta có thể viết lại phương trình thứ hai ở trên là $c = 10 h $ và thay thế phương trình này vào phương trình đầu tiên để loại bỏ $c $ cho $ 2 (10 h) + 4h = 30 $ hoặc $h = 5 $. Vì vậy, có những con ngựa $ \ đóng hộp {5} $ trong cuộc diễu hành.

Chúng ta áp dụng thuộc tính phân phối nhiều lần: \begin{align*}
(Q-5) (3r+6) &= q(3r+6) - 5(3r+6)\\
&= q\cdot 3r + q\cdot 6 - 5\cdot 3r - 5\cdot 6\\
&= \boxed{3qr + 6q - 15r -30}.
\end{align*}

Đơn giản hóa theo thứ tự các thao tác. \begin{align*}
3! (2^3+\sqrt{9})\div 2 &= 6(8+3)\div 2 \\
&=6(11)\div 2 \\
&=66\div 2\\
&=\đóng hộp{33}.
\end{align*}

Vì chúng ta biết rằng $f(x)=x^3+2x+1$ và $g(x)=x-1$, chúng ta có thể biểu thị $f(g(1))$ là $(x-1)^3+2(x-1)+1$. Do đó, khi $x=1$, chúng ta tìm thấy \begin{align*} (f(g(1))&=(1-1)^3+2(1-1)+1
\\ &=(0)^3+2(0)+1
\\ &=0+0+1
\\&=\đóng hộp{1}
\end{align*}

Chúng ta có thể tách phân số để có $\frac{6!} {5!} +\frac{4!} {5!} $. Sau đó, chúng ta có thể đơn giản hóa thương số của giai thừa:

\begin{align*}
\frac{6!} {5!} +\frac{4!} {5!} &= \frac{6\cdot5!} {5!} +\frac{4!} {5\cdot4!} \\
&=6+\frac15\\
&=\boxed{6\frac15}.
\end{align*}

Trong số 5 hộp có bút chì, 2 hộp cũng có bút, vì vậy $ 5-2 = 3 $ chỉ có bút chì.  Tương tự, $ 4-2 = 2 $ của các hộp chỉ có bút:

[tị nạn]
kích thước đơn vị (0,05cm);
nhãn ("Bút chì", (2,74));
nhãn ("Bút", (80,74));
bốc thăm(Vòng tròn((30,45), 22));
vẽ(Vòng tròn((58, 45), 22));
nhãn ("$ 2$", (44, 45));
nhãn (quy mô (0.8) * "$ 3 $", (28,58));
nhãn (quy mô (0.8) * "$ 2 $", (63,58));
[/asy]

Điều đó mang lại cho chúng tôi hộp $ 3 + 2 + 2 = 7 $ với bút, bút chì hoặc cả hai.  Điều này để lại $ 10-7 = \boxed{3}$ với cả hai.

problem:
Mười bốn khối màu trắng được ghép lại với nhau để tạo thành hình bên phải.  Bề mặt hoàn chỉnh của hình, bao gồm cả đáy, được sơn màu đỏ.  Hình sau đó được tách thành các khối riêng lẻ.  Có bao nhiêu hình khối riêng lẻ có chính xác bốn mặt đỏ?

[tị nạn]
kích thước(150);
cặp a = (1,0), b = (0,1), c = (0,45,0,4);

void drawcube(pair loc){
     filldraw (loc + b - loc - loc + a - loc + a + c - loc + a + b + c - loc + b + c - chu kỳ, màu trắng);
     Vẽ(loc+b--loc+a+b--loc+a+b+c^^loc+a+b--loc+a);
}

vị trí cặp[]={Origin,B,A,2A,3A,3A+B,-C,3A-C,-2C,-2C+B,-2C+A,-2C+A,-2C+2A,-2C+3A,-2C+3A+B};

for(int i; i<14;++i){
   drawcube (vị trí [i]);
}

[/asy]

$A$, $B$ và $C$ là các vùng tròn như được hiển thị. Có 7 mục trong vòng tròn $C $. Có chính xác 20 mặt hàng bằng $A đô la và 10 trong số những mặt hàng đó không phải là $B đô la. Có bao nhiêu mặt hàng bằng $B đô la, nhưng không phải bằng $C đô la?

[tị nạn]
vẽ (Vòng tròn ((0,0),50));
nhãn ("$A$",(39,39));
vẽ (Vòng tròn ((10,-10),32));
nhãn ("$B$",(-16,16));
vẽ (Vòng tròn ((5,-5),20));
nhãn ("$C$",(22,-22));
[/asy]

solution:
Chúng tôi có thể đơn giản hóa trực tiếp

\begin{align*}
2\left(\frac{7!} {3!4!} \right) &= 2\left(\frac{7\cdot 6 \cdot 5}{3 \cdot 2 \cdot 1}\right) \\
&= \frac{7 \cdot 6 \cdot 5}{3 \cdot 1} \\
&= 7 \cdot 2 \cdot 5 \\
&= \đóng hộp{70}
\end{align*}

