Trong vòng tròn $J $, $HO $ và $HN $ tiếp tuyến với vòng tròn ở mức $O $ và $N $. Tìm số độ trong tổng của $m\angle J$ và $m\angle H$. [tị nạn]
kích thước(150);
đồ thị nhập khẩu;
cặp J = (0,0), H = (6,0), O, N;
đường tròn = Vòng tròn (J,3);
cặp M = điểm giữa (J--H);
đường dẫn secCirc = Vòng tròn (M,3);
cặp [] tiếp tuyếnĐiểm = điểm giao nhau (circ, secCirc);
O = tiếp tuyếnĐiểm [0]; N = tiếp tuyến[1];
vẽ (J--N--H-O---chu kỳ);
vẽ (hình tròn);
nhãn ("$H$",H,E);
nhãn ("$J$", J, W);
nhãn ("$N$",N,S);
nhãn ("$O$",O,NE);
[/asy]

Hình chữ nhật $WXYZ$ được vẽ trên $ \ tam giác ABC $ , sao cho điểm $W $ nằm trên phân đoạn $AB $, điểm $X $ nằm trên phân đoạn $AC $ và các điểm $Y $ và $Z $ nằm trên phân đoạn $BC $, như được hiển thị. Nếu $m\angle BWZ=26^{\circ}$ and $m\angle CXY=64^{\circ}$, $m\angle BAC$, tính bằng độ là gì? [tị nạn]
