problem:
Trong tam giác $ABC $, điểm $D $ nằm trên phân đoạn $BC $, số đo góc $BAC $ là 40 độ và tam giác $ABD $ là sự phản ánh của tam giác $ACD $ trên phân đoạn $AD $. Thước đo góc $B $ là gì?

[tị nạn]
kích thước(101);
cặp B = (0,0); cặp C = (2,0); cặp D = (1,0); cặp A = (1, tan (70 * pi / 180));
draw (A--B--C--cycle, linewidth(1));
nhãn ("$A$",A,N); nhãn ("$B$",B,W); nhãn ("$C$",C,E);

vẽ (A--D, linetype ("2 4") + linewidth (1));
nhãn ("$D$", D, S); [/asy]

Trong sơ đồ, $PRT$ và $QRS$ là các đường thẳng. Giá trị của $x$là gì? [tị nạn]
Olympic nhập khẩu;
nhập khẩu toán;

kích thước (6cm); ĐIỀU CHỈNH

cặp r = (0, 0);
cặp t = dir (-55);
cặp s = dir(-55 - 70);
cặp p = dir(-55 + 180);
qr thực = Sin(70) / Sin(40);

cặp q = qr * dir(-55 - 70 + 180);

vẽ (r--p--q--s--t--r);

nhãn("$R$", r, 2 * E);
nhãn("$T$", t, SE);
nhãn ("$S$", s, SW);
nhãn ("$P$", p, W);
nhãn ("$Q$", q, E);

nhãn ("$x^\circ$", t, W + Tây Bắc + Tây Bắc);
nhãn ("$40^\circ$", q, 4 * SW);

add (pathticks (p--q, khoảng cách = 1, s = 4));
add (pathticks (q--r, khoảng cách = 1, s = 4));
add (pathticks (r--s, 2, khoảng cách = 1, s = 4));
add (pathticks (r--t, 2, khoảng cách = 1, s = 4));
[/asy]

