Trong tam giác cân $ABC$, nếu $BC$ được mở rộng đến một điểm $X$ sao cho $AC = CX$, số độ trong số đo góc $AXC$ là bao nhiêu? [asy] kích thước(220);
cặp B, A = B + dir(40), C = A + dir(-40), X = C + dir(0);
vẽ (C--A--B--X--A); vẽ (A / 2 + .1 * dir (-30) --A / 2-.1 * dir (-30));
vẽ ((A + C) / 2 + .1 * dir (30) - (A + C) / 2-.1 * dir (30));
nhãn ("A",A,N); nhãn ("C", C, S); nhãn ("B", B, S); nhãn ("X", X, S); label("$30^{\circ}$",B+.1*dir(0),NE);
