Vì $AT $ vuông góc với $TB $, chúng ta có thể coi $AT $ là chiều cao của $ \ tam giác ATB $ và $TB $ làm cơ sở. Diện tích của $\tam giác ATB$ là $$\frac{1}{2}\times TB\times AT = \frac{1}{2}\times(12-2)\times(12-0)=\frac{1}{2}\times10\times12=60.$$The diện tích $QABO$ là tổng diện tích của hình chữ nhật $QATO$ và $\tam giác ATB$, hoặc $24+60=\boxed{84}$.

