cặp P, Q;

P = (1,7,0,8);
Q = -P;

hòa ((-2,0)--(2,0));
hòa ((0,-2)--(0,2));
vẽ (P--Q, đứt nét);

dấu chấm ("$(a,b)$", P, NE);
dấu chấm ("$(-a,-b)$", Q, SW);
[/asy]

