solution:
Áp dụng thứ tự các phép toán sẽ cho \begin{align*}
3\cdot 3 +3(3+3) - 3^3 &= 3\cdot 3 +3(6) - 3^3\\
&= 3\cdot 3 + 3(6) - 27\\
&= 9 + 18 - 27 = \đóng hộp{0}.
\end{align*}

