Tam giác $POD$ là một tam giác 30-60-90, vì vậy $DO = \frac{\sqrt{3}}{2}$ và $DP = \frac12$.  Do đó, tọa độ của $P$ là $\left(-\frac{\sqrt{3}}{2}, -\frac12\right)$, so $$\tan 210^\circ =\frac{\sin 210^\circ}{\cos 210^\circ} = \frac{-1/2}{-\sqrt{3}/2} = \frac{1}{\sqrt{3}} = \boxed{\frac{\sqrt{3}}{3}}.$$

