solution:
Giải pháp đơn giản nhất là hình học. Hãy nhớ lại rằng $ | z | $ có thể được hiểu là khoảng cách $z $ từ nguồn gốc trong mặt phẳng phức; Thông tin đã cho cho chúng ta biết rằng $z$ nằm trên một vòng tròn bán kính 5 và $w$ nằm trên một vòng tròn bán kính 2. Vẽ các vòng tròn này trong mặt phẳng phức, chúng ta thấy rằng $z $ và $w $ gần nhau nhất khi chúng nằm trên bán kính chung, với $w $ trong cùng góc phần tư với $z $. Điều này cho giá trị tối thiểu là $|z-w|$ là $5 - 2 = \boxed{3}$. (Đây là một trường hợp đặc biệt của bất đẳng thức tam giác đối với các số phức.)

[tị nạn]
đơn vị kích thước (0,5 cm);

cặp Z, W;

Z = 2 * dir (34);
W = 5 * dir (78);

vẽ (Vòng tròn ((0,0), 2), màu đỏ);
vẽ (Vòng tròn ((0,0), 5), màu xanh lam);
vẽ (Z--W);

dấu chấm ("$z$", Z, SW);
dấu chấm("$w$", W, N);
[/asy]

