Đầu tiên, chúng ta lưu ý rằng $\tan D = \frac{\sin D}{\cos D}$, vì vậy $\tan D = 3\sin D$ cho chúng ta $\frac{\sin D}{\cos D} = 3\sin D$, từ đó chúng ta có $\cos D = \frac13$.  Sau đó, chúng tôi lưu ý rằng $\sin F = \frac{DE}{DF} = \cos D = \boxed{\frac13}$.

Hãy xem xét một tam giác vuông trong đó cạnh liền kề là 1 và cạnh huyền là 3.

[tị nạn]
