hòa ((0,-1)--(0,5));
vẽ (arc ((0,0), 4,0,180), đỏ, Mũi tên (6));

dấu chấm ((-4,0), màu đỏ);
nhãn ("$(-4,0)$", (-4,0), S);
dấu chấm((4,0), màu đỏ);
[/asy]

Do đó, tọa độ cực là $\boxed{(4,\pi)}.$

[tị nạn]
cặp L, M, N;
N = (0,0);
M = (2,0);
L = (2,-sqrt(21));
vẽ (L--M--N--L);
vẽ (rightanglemark (L, M, N, 10));
nhãn ("$M$", M, NE);
nhãn ("$L$", L, SE);
nhãn ("$N$",N,NW);
nhãn ("$ 2 $", (N + M) / 2, Tây Bắc);
nhãn ("$\sqrt{21}$",(M+L)/2,E);
[/asy]

Vì đây là tam giác vuông, $\sin L = \frac{MN}{LN}.$

Sử dụng Định lý Pythagore, chúng ta thấy rằng $$LN = \sqrt{MN^2 + LM^2} = \sqrt{4 + 21} = 5,$$Then $\sin L = \boxed{\frac{2}{5}}$.
